import{d as a}from"./app.61465fad.js";const s={},n=a('<h2 id="介绍" tabindex="-1"><a class="header-anchor" href="#介绍" aria-hidden="true">#</a> 介绍</h2><p>clone 大项目时总是乏力，下载速度极慢，这时就需要为其设置代理了。</p><h2 id="代理" tabindex="-1"><a class="header-anchor" href="#代理" aria-hidden="true">#</a> 代理</h2><ol><li><p>全局代理</p><p>该项可参考 <a href="/os/linux/alias">alias</a> 部分内容。</p><div class="language-bash ext-sh"><pre class="language-bash"><code>gfw\n</code></pre></div></li><li><p>git 代理</p><p>在 Git 官网可获得提示 <code>http.proxy</code>，虽然在其余地方搜索还得到提示 <code>https.proxy</code>，但在官网并没有搜到对应内容，怀疑是误传。</p><div class="language-bash ext-sh"><pre class="language-bash"><code><span class="token comment"># 设置代理 </span>\n<span class="token function">git</span> config --global http.proxy <span class="token string">&#39;socks5://127.0.0.1:1080&#39;</span>\n<span class="token comment"># 取消代理</span>\n<span class="token function">git</span> config --global --unset http.proxy\n\n<span class="token comment"># 更好的形式当然是设置为 alias</span>\n<span class="token builtin class-name">alias</span> <span class="token assign-left variable">proxygit</span><span class="token operator">=</span><span class="token string">&quot;git config --global http.proxy socks5://127.0.0.1:1080&quot;</span>\n<span class="token builtin class-name">alias</span> <span class="token assign-left variable">uproxygit</span><span class="token operator">=</span><span class="token string">&quot;git config --global --unset http.proxy&quot;</span>\n</code></pre></div></li></ol><h2 id="说明" tabindex="-1"><a class="header-anchor" href="#说明" aria-hidden="true">#</a> 说明</h2><p>git 代理支持多种协议：<code>http、https、socks、socks5</code>，本机通过 <code>ss</code> 启用了 socks5。</p>',6);s.render=function(a,s){return n};export default s;
